import { Grid, Slider, TextField } from "@mui/material";
import React, { useState } from "react";

function PriceRangeSlider() {
  const [valueRange, setValueRange] = useState([100000, 1000000]);

  return (
    <div className="price-filter">
      <div className="title">Harga</div>
      <div className="range">
        <Slider
          value={valueRange}
          onChange={(e, newValue) => setValueRange(newValue)}
          valueLabelDisplay="auto"
          aria-labelledby="range-slider"
          min={0}
          max={2250000}
          sx={{
            "& .MuiSlider-thumb": {
              color: "#EB3F36", // Ubah warna thumb menjadi warna EB3F36
            },
            "& .MuiSlider-track": {
              color: "#EB3F36", // Ubah warna track menjadi warna EB3F36
            },
            "& .MuiSlider-rail": {
              color: "#757575", // Ubah warna rail menjadi warna EB3F36
            },
          }}
        />
      </div>
      <div className="nominal">
        <Grid container spacing={2}>
          <Grid item>
            <TextField
              label="Minimum Price"
              variant="outlined"
              type="number"
              value={0}
              onChange={() => {}}
              // onBlur={handleInputBlur}
              inputProps={{ min: 100000, max: 1000000 }}
              sx={{
                width: "100px",
                height: "30px",
                border: "1px solid #F2F2F2",
                background: "rgba(248, 248, 248, 0.75)",
              }}
            />
          </Grid>
          <Grid item>
            <TextField
              label="Maximum Price"
              variant="outlined"
              type="number"
              value={10000000}
              onChange={() => {}}
              // onBlur={handleInputBlur}
              inputProps={{ min: 100000, max: 1000000 }}
              sx={{
                width: "100px",
                height: "30px",
                border: "1px solid #F2F2F2",
                background: "rgba(248, 248, 248, 0.75)",
              }}
            />
          </Grid>
        </Grid>
      </div>
    </div>
  );
}

export default PriceRangeSlider;
